class Solution {
public:
    int sumOfPower(vector<int>& nums, int k) {
        unordered_map<int, int> m;
        int ans = 0;
        for (int i = 0; i < nums.size(); ++i) {
            int t = 0;
            for (int j = i; j < nums.size(); ++j) {
                t += nums[j];
                if (t == k) {
                    ans++;
                } else if (t > k) {
                    break;
                }
                ans += m[k - t];
            }
            m[nums[i]]++;
        }
        return ans;
    }
};
